import React from 'react'
import { styled, alpha } from '@mui/material/styles'
import AppBar from '@mui/material/AppBar'
import Box from '@mui/material/Box'
import Toolbar from '@mui/material/Toolbar'
import IconButton from '@mui/material/IconButton'
import Typography from '@mui/material/Typography'
import InputBase from '@mui/material/InputBase'
import MenuItem from '@mui/material/MenuItem'
import Menu from '@mui/material/Menu'
import MoreIcon from '@mui/icons-material/MoreVert'

// const Search = styled('div')(({ theme }) => ({
//   position: 'relative',
//   borderRadius: theme.shape.borderRadius,
//   backgroundColor: alpha(theme.palette.common.white, 0.15),
//   '&:hover': {
//     backgroundColor: alpha(theme.palette.common.white, 0.25),
//   },
//   marginRight: theme.spacing(2),
//   marginLeft: 0,
//   width: '100%',
//   [theme.breakpoints.up('sm')]: {
//     marginLeft: theme.spacing(3),
//     width: 'auto',
//   },
// }))

// const SearchIconWrapper = styled('div')(({ theme }) => ({
//   padding: theme.spacing(0, 2),
//   height: '100%',
//   position: 'absolute',
//   pointerEvents: 'none',
//   display: 'flex',
//   alignItems: 'center',
//   justifyContent: 'center',
// }))

// const StyledInputBase = styled(InputBase)(({ theme }) => ({
//   color: 'inherit',
//   '& .MuiInputBase-input': {
//     padding: theme.spacing(1, 1, 1, 0),
//     // vertical padding + font size from searchIcon
//     paddingLeft: `calc(1em + ${theme.spacing(4)})`,
//     transition: theme.transitions.create('width'),
//     width: '100%',
//     [theme.breakpoints.up('md')]: {
//       width: '50ch',
//     },
//   },
// }))

const Navbar = () => {
  const [anchorEl, setAnchorEl] = React.useState(null)
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = React.useState(null)

  // const isMenuOpen = Boolean(anchorEl)
  const isMobileMenuOpen = Boolean(mobileMoreAnchorEl)

  // const handleProfileMenuOpen = (event) => {
  //   setAnchorEl(event.currentTarget)
  // }

  const handleMobileMenuClose = () => {
    setMobileMoreAnchorEl(null)
  }

  // const handleMenuClose = () => {
  //   setAnchorEl(null)
  //   handleMobileMenuClose()
  // }

  const handleMobileMenuOpen = (event) => {
    setMobileMoreAnchorEl(event.currentTarget)
  }

  // const menuId = 'primary-search-account-menu'
  // const renderMenu = (
  //   <Menu
  //     anchorEl={anchorEl}
  //     anchorOrigin={{
  //       vertical: 'top',
  //       horizontal: 'right',
  //     }}
  //     id={menuId}
  //     keepMounted
  //     transformOrigin={{
  //       vertical: 'top',
  //       horizontal: 'right',
  //     }}
  //     open={isMenuOpen}
  //     onClose={handleMenuClose}
  //   >
  //     <MenuItem onClick={handleMenuClose}>
  //       <IconButton>
  //         <LogoutIcon fontSize='small' />
  //       </IconButton>
  //       <Typography variant='inherit' sx={{fontSize:"0.3rem"}}>Log</Typography>
  //     </MenuItem>
  //   </Menu>
  // )

  const mobileMenuId = 'primary-search-account-menu-mobile'
  const renderMobileMenu = (
    <Menu
      anchorEl={mobileMoreAnchorEl}
      anchorOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      id={mobileMenuId}
      keepMounted
      transformOrigin={{
        vertical: 'top',
        horizontal: 'right',
      }}
      open={isMobileMenuOpen}
      onClose={handleMobileMenuClose}
    >
      <MenuItem
        onClick={(e) => {
          console.log('login at Navbar')
        }}
      >
        {/* <IconButton
          size='small'
          aria-label='account of current user'
          aria-controls='primary-search-logout'
          aria-haspopup='true'
          color='inherit'
        >
          <LoginIcon />
        </IconButton> */}
        <img
          src='https://img.icons8.com/external-yogi-aprelliyanto-detailed-outline-yogi-aprelliyanto/32/26e07f/external-log-in-arrow-yogi-aprelliyanto-detailed-outline-yogi-aprelliyanto.png'
          width={'32px'}
          height={'32px'}
          alt='login'
        />
        <Typography
          variant='inherit'
          sx={{
            fontSize: '0.9rem',
            padding: '0.5rem 1rem',
            fontWeight: '500',
          }}
        >
          Log In
        </Typography>
      </MenuItem>
      <MenuItem>
        {/* <IconButton
          size='small'
          aria-label='account of current user'
          aria-controls='primary-search-logout'
          aria-haspopup='true'
          color='inherit'
        >
          <LoginIcon />
        </IconButton> */}

        <img
          src='https://img.icons8.com/external-itim2101-lineal-itim2101/32/26e07f/external-typewriter-copywriting-itim2101-lineal-itim2101.png'
          width={'32px'}
          height={'32px'}
          alt='register'
        />
        {/* <img
          src='https://img.icons8.com/external-smashingstocks-detailed-outline-smashing-stocks/66/26e07f/external-typewriter-stationery-and-office-equipment-smashingstocks-detailed-outline-smashing-stocks.png'
          width={'30px'}
          height={'30px'}
          alt='register'
        /> */}
        <Typography
          variant='inherit'
          sx={{
            fontSize: '0.9rem',
            padding: '0.5rem 1rem',
            fontWeight: '500',
          }}
        >
          Try Typing
        </Typography>
      </MenuItem>
    </Menu>
  )

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position='static' sx={{ backgroundColor: '#323132' }}>
        <Toolbar>
          <Typography
            variant='h6'
            noWrap
            component='div'
            sx={{ display: { xs: 'block', sm: 'block' }, flexGrow: 1 }}
          >
            TYPING
          </Typography>
          {/* <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder='Searchâ€¦'
              onChange={(e) => setSearchNote(e.target.value)}
              inputProps={{ 'aria-label': 'search' }}
            />
          </Search> */}
          <Box sx={{ flexGrow: 1 }} />
          <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
            <Typography
              variant='h6'
              noWrap
              component='div'
              sx={{ paddingRight: '1rem', fontSize: '1rem' }}
            >
              Log In
            </Typography>
            <Typography
              variant='h6'
              noWrap
              component='div'
              sx={{ paddingRight: '1rem', fontSize: '1rem' }}
            >
              Try Typing
            </Typography>
          </Box>
          {/* <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
            <IconButton
              size='large'
              edge='start'
              color='inherit'
              aria-label='menu'
              aria-controls={menuId}
              aria-haspopup='true'
              onClick={handleProfileMenuOpen}
            >
              <MenuItem />
            </IconButton>
          </Box> */}

          <Box sx={{ display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size='large'
              aria-label='show more'
              aria-controls={mobileMenuId}
              aria-haspopup='true'
              onClick={handleMobileMenuOpen}
              color='inherit'
            >
              <MoreIcon />
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>
      {renderMobileMenu}
      {/* {renderMenu} */}
    </Box>
  )
}

export default Navbar
